import ThemeChanger from "./components/ThemeChanger";
import React from "react";
import { gsap } from "gsap";

const App = () => {
  const [open, setOpen] = React.useState(false);

  return (
    <div>
      <ThemeChanger open={open} setOpen={setOpen} />
      <header>
        <a href="#">logo</a>
        <ul>
          <li><a href="#">home</a></li>
          <li><a href="#">work</a></li>
          <li><a href="#">contact</a></li>
        </ul>
      </header>
    </div>
  );
}

export default App;
